            var html_6f901c0a6ced424c8b88e58ed1f0a0cd = $(`<div id="html_6f901c0a6ced424c8b88e58ed1f0a0cd" style="width: 100.0%; height: 100.0%;">      <div align='center'><b>Walk 9</b><br></div>            <div align='left'><b>Distnace: </b>10km<br></div>            <div align='left'><b>Time: </b>3,5hrs<br></div>      Þingvellir can be described as a cultural and historic area in a fascinating geological landscape, possibly even ‘sacred’ to Icelanders. Settlers would travel here from all over Iceland, to formulate their laws and commit them to memory. The peculiar acoustics of the ‘Law Rock’ allowed one man to recite the laws so that thousands of people could hear them. It is a place of history and heritage, with cliffs, lakes, rivers, woods and fissured bedrock. Easy paths become more rugged later, crossing the low hill of Skógarkot</div>`)[0];
